var status = "parado";

record.onclick = function() {
  if (status == "gravando") {
    stop_record();
    status = "parado";
  } else {
    play_record();
    status = "gravando";
  }
  console.log(status);
};

playstop.onclick = function() {
  if (status == "tocando") {
    stop_music();
    status = "parado";
  } else {
    play_music();
    status = "tocando";
  }
  console.log(status);
};

